export default {
  name: 'AddDialog',
  props: {
    addText: {
      type: String,
      default: ''
    }
  },
  data() {
    return {
      loading: false,
      addForm: {
        name: ''
      },
      addRules: {
        name: [{ required: true, message: '请输入' + this.addText + '名称', trigger: 'blur' }]
      }
    }
  },
  methods: {
    cancelAdd: function() {
      this.$emit('canceldlg')
    },
    submitAdd: function() {
      this.$refs.addForm.validate((valid) => {
        if (valid) {
          this.loading = true
          this.$emit('submitdlg', this.addForm.name)
        } else {
          return
        }
      })
    }
  }
}
